export const Eyes = () => {
    return(
      <>
      <circle
        r={eyeRadius}
        cx={- eyeOffsetX}
        cy={- eyeOffsetY}
        fill="black"
      />

      <circle
        r={eyeRadius}
        cx={+ eyeOffsetX}
        cy={- eyeOffsetY}
        fill="black"
      />
      </>
    )
  };
